import streamlit as st
import pandas as pd
import seaborn as sns
import matplotlib.pyplot as plt
from imblearn.under_sampling import RandomUnderSampler

def app():
  df = pd.read_csv('https://raw.githubusercontent.com/Erik-Henrique/Analise_Diabetes_Semantix/refs/heads/main/diabetes_prediction_dataset.csv')
  df.drop_duplicates(inplace=True)
  df.drop(df[df['genero']=="Other"].index, inplace=True)
  df.genero = df.genero.map({'Female': 0, 'Male': 1})
  
  under = RandomUnderSampler(random_state=0)
  x_under, y_under = under.fit_resample(df.drop(columns='diabete'), df['diabete'])
  df_under = pd.concat([x_under, y_under], axis=1)
  
  seleção = st.selectbox(
          'Selecione a análise desejada:',
          ('Distribuição da Variável Idade', 'Distribuição da Variável IMC', 'Distribuição da Variável Hemoglobina A1c', 'Distribuição da Variável Glicose', 'Distribuição da Variável Gênero',
           'Distribuição da Variável Hipertenso', 'Distribuição da Variável Problema no Coração', 'Distribuição da Variável Fumante', 'Distribuição da Variável Diabetes'), 
           index = None, placeholder= 'Clique aqui para selecionar a análise desejada')
  
  if seleção == 'Distribuição da Variável Idade':
      col1, col2 = st.columns(2)
    
      with col1:
          st.markdown('![img](data:image/png;base64,)')
          st.markdown('![img](data:image/png;base64,)')
      
      with col2:
         st.write('### Análise')
         st.write('Notamos que a idade dos pacientes analisados apresenta grande variação, concentrando-se mais após os 40 anos.')
         st.write('- Podemos ver pela análise percentual que, quanto maior a idade, maior é a quantidade de pacientes com diabetes percentualmente, corroborando o fato de a doença se manifestar com mais frequência após os 40 anos.')
  
  if seleção == 'Distribuição da Variável IMC':
      col1, col2 = st.columns(2)
    
      with col1:
          fig, ax = plt.subplots()
          ax.hist(x='imc', data=df_under, bins=40)
          st.pyplot(fig)
      
      with col2:
         st.write('### Análise')
         st.write('Notamos uma grande concentração em um único valor próximo de 30; no entanto, o restante dos valores também se concentra entre 25 e 35.')
         st.write('Isso nos mostra que a grande maioria dos pacientes analisados apresenta um valor de IMC que varia entre bom e início de alerta, uma vez que até 27 o valor é considerado normal, enquanto acima de 30 já se torna preocupante.') 
  
  if seleção == 'Distribuição da Variável Hemoglobina A1c':
      col1, col2 = st.columns(2)
    
      with col1:
          st.markdown('![img](data:image/png;base64,)')
          st.markdown('![img](data:image/png;base64,)')
      
      with col2:
         st.write('### Análise')
         st.write('Notamos uma clara concentração dos dados entre 5,7 e 6,6, com o restante das ocorrências bem distribuídas entre os outros valores.')
         st.write('- Notamos, ao analisar percentualmente, que os valores mais repetidos têm um equilíbrio entre diabéticos e não diabéticos. No entanto, os demais dados são bem discriminados: 100% dos pacientes com A1c acima de 6,7 são diabéticos, enquanto todos com A1c menor que 5 não são.')
         st.write('- Notamos que essa variável é altamente discriminante, o que indica que será muito importante para o modelo.')
  
  if seleção == 'Distribuição da Variável Glicose':
      col1, col2 = st.columns(2)
    
      with col1:
          st.markdown('![img](data:image/png;base64,)')
          st.markdown('![img](data:image/png;base64,)')
      
      with col2:
         st.write('### Análise')
         st.write('Notamos uma clara concentração dos dados entre 101 e 200, com o restante das ocorrências bem distribuídas entre os outros valores.')
         st.write('- Notamos, ao analisar percentualmente, que os valores mais repetidos têm um equilíbrio entre diabéticos e não diabéticos. No entanto, os demais dados são bem discriminados: 100% dos pacientes com Glicose acima de 200 são diabéticos, enquanto todos com Glicose menor que 101 não são.')
         st.write('- Notamos que essa variável é altamente discriminante, o que indica que será muito importante para o modelo.')
  
  if seleção == 'Distribuição da Variável Gênero':
      col1, col2 = st.columns(2)
    
      with col1:
          st.markdown('![img](data:image/png;base64,)')
          st.markdown('![img](data:image/png;base64,)')
      
      with col2:
         st.write('### Análise')
         st.write('Notamos que há mais mulheres do que homens no DataFrame.')
         st.write('- O gênero não é um fator determinante para o desenvolvimento de diabetes; outros fatores, como percentual de gordura corporal, prática de atividades físicas e alimentação, são mais relevantes.')
         st.write('- Neste DataFrame, os homens são, percentualmente, mais propensos a ter diabetes do que as mulheres.')
  
  if seleção == 'Distribuição da Variável Hipertenso':
      col1, col2 = st.columns(2)
    
      with col1:
          st.markdown('![img](data:image/png;base64,)')
          st.markdown('![img](data:image/png;base64,)')
      
      with col2:
         st.write('### Análise')
         st.write('Notamos uma diferença significativa na quantidade de pacientes com hipertensão.')
         st.write('- A hipertensão pode ser um agravante para o desenvolvimento do diabetes ou ser causada por ele. Podemos notar a diferença percentual entre os pacientes hipertensos, onde cerca de 80% são diabéticos.')
  
  if seleção == 'Distribuição da Variável Problema no Coração':
      col1, col2 = st.columns(2)
    
      with col1:
          st.markdown('![img](data:image/png;base64,)')
          st.markdown('![img](data:image/png;base64,)')
      
      with col2:
         st.write('### Análise')
         st.write('Notamos uma diferença significativa na quantidade de pacientes com problemas no coração.')
         st.write('- Os problemas cardiacos podem ser um agravante para o desenvolvimento do diabetes ou serem causados por ele. Podemos notar a diferença percentual entre os pacientes com problemas cardiacos, onde cerca de 80% são diabéticos.')
  
  if seleção == 'Distribuição da Variável Diabetes':
      col1, col2 = st.columns(2)
    
      with col1:
          st.markdown('![img](data:image/png;base64,)')
      
      with col2:
         st.write('### Análise')
         st.write('A variável alvo foi redimensionada no DataFrame para que fiquem equilibradas e possam performar melhor no DataFrame e ajudar a encontrar padrões.')
  
  if seleção == 'Distribuição da Variável Fumante':
      col1, col2 = st.columns(2)
    
      with col1:
          st.markdown('![img](data:image/png;base64,)')
          st.markdown('![img](data:image/png;base64,)')
      
      with col2:
         st.write('### Análise')
         st.write('Notamos que há mais pacientes que nunca fumaram, seguidos por aqueles que não forneceram essa informação de forma precisa.')
         st.write('- Percebemos na análise percentual que os pacientes que não informaram seu status de tabagismo (fumante ou não) apresentam o menor percentual de diabéticos.')
         st.write('- Percebemos também que todas as categorias de pacientes que fumam ou já fumaram possuem maior percentual de diabéticos, além de apresentarem um percentual maior de diabéticos em comparação com aqueles que nunca fumaram.')
